import React from 'react';

const NominationList = ({ nominations }) => {
    const renderedList = nominations.map((nomination) => {
        return <div key={nomination.imdbID}>{nomination.Title}</div>
    });

    if (nominations.length === 0) {
        return (
            <div>There are no nominations</div>
        );
    }

    return (
        <div>
            Nominations:
            {renderedList}
        </div>
    );
};

export default NominationList;
